import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Layout from './components/Layout';
import Dashboard from './pages/Dashboard';
import VirtualHosts from './pages/VirtualHosts';
import Databases from './pages/Databases';
import EmailAccounts from './pages/EmailAccounts';
import FTPAccounts from './pages/FTPAccounts';
import SSLCertificates from './pages/SSLCertificates';
import DNSRecords from './pages/DNSRecords';
import Settings from './pages/Settings';
import Login from './pages/Login';
import { AuthProvider } from './contexts/AuthContext';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/" element={<PrivateRoute><Layout /></PrivateRoute>}>
            <Route index element={<Dashboard />} />
            <Route path="virtual-hosts" element={<VirtualHosts />} />
            <Route path="databases" element={<Databases />} />
            <Route path="email-accounts" element={<EmailAccounts />} />
            <Route path="ftp-accounts" element={<FTPAccounts />} />
            <Route path="ssl-certificates" element={<SSLCertificates />} />
            <Route path="dns-records" element={<DNSRecords />} />
            <Route path="settings" element={<Settings />} />
          </Route>
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
